INSERT INTO `t_book` VALUES (10, '有理想就有疼痛', '高晓春', '', '9787212058937', '《有理想就有疼痛:中国当代文化名人访谈录》是一份关于当代中国文化的最真实底稿，收录了高晓春与白先勇、冯骥才、余华、莫言、余秋雨、陈忠实等20位当代中国文化大家的对话。通过近距离的访谈，展现了这些文化大家多彩的内心世界，也阐释了他们对生命、艺术、财富及文化的理解。', 29.00, '2013-01-01', 2, 'https://img11.360buyimg.com/n1/jfs/t6028/153/757041799/410919/1d6eab95/592bf16fN150235d2.jpg', 2, 1, '0a55f84521df4ce99a1ac9b6218c7d15');
