INSERT INTO `t_book` VALUES (16, 'Spring实战（第4版）', 'Craig Walls 沃尔斯', '人民邮电出版社', '9787115417305', '《Spring实战（第4版）》是经典的、畅销的Spring学习和实践指南。\n第4版针对Spring 4进行了全面更新。全书分为四部分。第1部分介绍Spring框架的核心知识。第二部分在此基础上介绍了如何使用Spring构建Web应用程序。第三部分告别前端，介绍了如何在应用程序的后', 89.00, '2016-03-31', 3, 'http://api.jisuapi.com/isbn/upload/1/11.jpg', 1, 1, '4c1514d0f5b3441fb44531f60ca9a99a');

